import { useState } from "react";

const Comment = (props) => {
  return (
    <div className="comment-container">
      <div className="comment">
        <div className="comment-heading">
          <img
            className="user-avatar"
            src={props.user.image.png}
            alt="user avatar"
          />
        </div>
      </div>
    </div>
  );
};
